    genRandomString(length = 32, characters = '0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ_-') {
		let result = '';
		for (let i = 0; i < length; i++) {
			 result += characters.charAt(Math.floor(Math.random() * characters.length));
		}
		return result;
	} 
    
    parseUrl(url) {
		try {
			return new URL(url);
		} catch(err) {
			return {};
		}
	} 
    
    parseUrlParameter(url) {
		try {
			const parameters = {};
			const urlObj = this.parseUrl(url);
			const searchParams = new URLSearchParams(urlObj ?. search);
			for (const[key, value] of searchParams) {
				parameters[key] = value;
			}
			if (urlObj ?. hash && urlObj.hash.includes('#/')) {
				const hashParams = urlObj.hash.replace('#/', '');
				const hashSearchParams = hashParams.includes('?') ? new URLSearchParams(hashParams.split('?').slice(1).join('?')) : new URLSearchParams();
				for (const[key, value] of hashSearchParams) {
					parameters[key] = value;
				}
			}
			return parameters;
		} catch {
			return {};
		}
	} 
    
    getUrlParameter(url, key) {
		try {
			const urlObj = this.parseUrl(url),
			result = urlObj.searchParams.get(key);
			return result || '';
		} catch {
			return '';
		}
	} 
    
    objectToQueryString(obj) {
		try {
			const rseult = [];
			for (const key in obj) {
				if (obj.hasOwnProperty(key)) {
					const value = obj[key];
					const encodeKey = encodeURIComponent(key);
					const encodeValue = value === null || (value === undefined) ? '': encodeURIComponent(value);
					rseult.push(encodeKey + '=' + encodeValue);
				}
			}
			return rseult.join('&');
		} catch {
			return '';
		}
	} 
    
    queryStringToObject(str) {
		try {
			const result = {};
			const arr = str.split('&');
			for (const item of arr) {
				const[key, value] = item.split('=');
				result[decodeURIComponent(key)] = (value === undefined) ? null: decodeURIComponent(value);
			}
			return result;
		} catch {
			return {};
		}
	} 
    
    parseResponseCookie(response) {
		const result = {};
		try {
			if (typeof response === 'object' && response ?. headers && response ?. headers['set-cookie']) {
				const cookies = response.headers['set-cookie'];
				for (const cookie of cookies) {
					const array = cookie.split(';')[0];
					result[array.substr(0, array.indexOf('='))] = array.substr(array.indexOf('=') + 1);
				}
			}
		} catch {}
		return result;
	} 
    
