    getCookieValue(cookie, key) {
		if(!cookie || !key) return '';
		const reg = new RegExp(key + "=([^;]*)");
		const val = reg.exec(cookie.trim().replace(/\s/g, ''));
		return val && val[1] || '';
	} 
    
    parseCookie(cookie) {
		const result = {};
		const arr = cookie.split(';');
		for (const item of arr) {
			const[key, value] = item.trim().split('=');
			result[key] = value;
		}
		return result;
	} 
    
