	/**
	 * 并发执行异步任务，控制并发数量和总迭代次数
	 * @param {number} taskLimit - 同时执行的最大异步任务数量
	 * @param {number} maxIterations - 总共执行的最大迭代次数
	 * @param {Function} taskHandler - 异步任务处理函数，接受当前迭代次数作为参数并返回一个 Promise
	 * @returns {Promise} - 返回一个 Promise，表示所有任务执行完成
	 */
	async concTaskNormal(taskLimit = '3', maxIterations = 100, taskHandler) {
		let taskCompleted = false,
		runningTasks = 0,
		currentIteration = 0;
		async function executeTask(taskIndex) {
			const taskResult = await taskHandler(taskIndex);
			if (taskResult) {
				if (typeof taskResult === 'boolean') taskCompleted = true;
				else (typeof taskResult === 'object') && (taskResult ?. runEnd && (taskCompleted = true));
			}
			runningTasks--,
			runTasks();
		}
		async function runTasks() {
			while (runningTasks < taskLimit && maxIterations >0 && !taskCompleted) {
				maxIterations--,
				runningTasks++,
				currentIteration++,
				await executeTask(currentIteration);
			}
			if (taskCompleted) {
				await new Promise(resolve =>{
					const timer = setInterval(() =>{
						runningTasks === 0 && (clearInterval(timer), resolve());
					},
					100);
				});
			}
		}
		const taskLimitCount = Math.min(maxIterations, taskLimit),
		taskPromises = [];
		for (let i = 0; i < taskLimitCount; i++) {
			maxIterations--;
			runningTasks++;
			currentIteration++;
			taskPromises.push(executeTask(currentIteration));
		}
		await Promise.all(taskPromises);
		await runTasks();
		await new Promise(resolve =>{
			const timer = setInterval(() =>{
				((runningTasks === 0) || taskCompleted) && (clearInterval(timer), resolve());
			},
			100);
		});
	} 
    
