    /**
     * 获取登录状态
     * @param {string} cookie - Cookie 字符串，默认为 this._Cookie
     * @returns {boolean|undefined} - 如果登录状态为已登录则返回 true，否则返回 false
     */
    async getLoginStatus(cookie = this._Cookie) {

        if (!cookie) {
            console.log("🚫 getLoginStatus 请求失败 ➜ 未设置Cookie");
            return false;
        }

        try {
            const options = {
                'url': "https://plogin.m.jd.com/cgi-bin/ml/islogin",
                'method': 'GET',
                'headers': {
                    'Accept': '*/*',
                    'Accept-Encoding': 'gzip, deflate, br',
                    'Accept-Language': 'zh-CN,zh-Hans;q=0.9',
                    'Cookie': cookie,
                    'Host': 'plogin.m.jd.com',
                    'User-Agent': this._UserAgent || this._defaultUserAgent
                },
                'timeout': 30000,
                'debug': false
            };

            const res = await this.request(options);

            if (!res.success) {
                console.log('🚫 getLoginStatus 请求失败 ➜ ' + res.error);
            }

            if (!res.data) {
                console.log('🚫 getLoginStatus 请求异常 ➜ 无响应数据');
            }

            const islogin = res.data?.islogin;

            return islogin === '1';
        } catch (err) {
            console.log('❌ getLoginStatus 在处理请求中遇到了错误 ' + err);
        }
        return false;
    }

